function getArrRndomNumber(arr, count) {
	var len = arr.length;
	var newArr = [];
	!(function randomArr() {
		var num = Math.floor(Math.random() * len);
		if (newArr.length === 0) {
			newArr.push(arr[num]);
		} else {
			len = arr.length;
			for (var i = 0; i < len; i++) {
				if (newArr[i] == arr[num]) {
					randomArr();
					return;
				}
			}
			newArr.push(arr[num]);
		}

		if (newArr.length == count) {
			return;
		} else {
			randomArr();
		}
	})();
	return newArr;
}
